import { getCoures } from "../ActionType";

export const getCourses = () => {
  console.log("action start");
  return async (dispatch) => {
    fetch("https://quran-server.herokuapp.com/course")
      .then((res) => res.json())
      .then((res) => {
        // console.log("ssssss", res);
        dispatch({
          type: addToCart,
          addToCart: res,
        });
      });
  };
};
